import { useState } from "react";
import CompSum from "./components/CompSum";

let arrList = ['1', '2', '3']

function App() {

  const [] = useState()

  return (
    <>
      <h1>중첩컴포넌트</h1>
      {
        arrList.map(v=>{
          <CompSum key={v} />
        })
      }
      <hr />
      <button>문제삭제</button>
      <button>문제제출</button>
    </>
  );
}

export default App;
